function Education() {
    return (
        <div class="row">
            <h2>Education</h2>
            <div class="column">
                
                <div>
                    <h2>BE</h2>
                    <p>Anantrao Pawar College of Engineering and Research</p>
                    <div className="row">
                        <div className="column">08/2018</div>
                        <div className="column">07/2022</div>
                    </div>
                </div>
                
            </div>
            {/* <div class="column">
                <h2>Column 2</h2>
                <p>Some text..</p>
            </div> */}
        </div>
    );
}

export default Education;
